const bell2 = "data:audio/mp3;base64,"

console.log('is gpt')
chrome.runtime.onMessage.addListener((request, options) => {
    console.log(request)
    if (request.name === 'chat_gpt') {
        if (request.status === 'done') {
            fetch(bell2).then((res) => res.blob()).then((blob) => {
                const blobURL = URL.createObjectURL(blob)
                const bellSound = new Audio(blobURL)
                bellSound.play()
                console.log('req ended')
            })
        }
    }
});
